import React from "react";
import Add from "./routes";
import { BrowserRouter as Router,Routes,Route } from "react-router-dom";

function App(){
    return(
        <div>
            <h1>Welcome to Gtyde technologies</h1>
            <Router>
                <Routes>
                    <Route path="/" element={<Add/>}/>
                    <Route path="/pro" element={<Pro/>}/>
                </Routes>
            </Router>
        </div>
    )
}

export default App;
